import "../styles/App.css";

export default function Footer() {
  return (
    <footer className="footer">
      <div>
        <strong>SafeRoute</strong>
        <p>Safety-first navigation system</p>
      </div>
      <div>
        <p>Contact</p>
        <p>Email: sushmitajena845@gmail.com</p>
      </div>
    </footer>
  );
}
